ReactDOM.render(<>
        <h1> Lakshya Bhardwaj!! </h1>
        <p>Welcome to my React app...</p>
        <ol>
          <li>Breaking Bad</li>
          <li>House of Cards</li>
          <li>Game of Thrones</li>
          <li>Sacred Games</li>
          <li>Paatal Lok</li>
        </ol>
        </>,
        document.getElementById("root"));
